import Navbar from '../Navbar-view'
import { connect } from 'react-redux'
import { BrowserRouter as Redirect } from "react-router-dom";
import axios from 'axios'
import React from 'react'
import { userHasLoggedOut, authenticationError } from '../../../actions'

const NavbarOther = ({ authenticationError, active }) => {

    return <Navbar onSignupClick={() => {
        return <Redirect to="/homeglobe" />
    }} onSigninClick={() => {
        if (active) {
            axios.get('http://localhost:3000/users/logout').catch(err => alert(err))
            userHasLoggedOut()
            return
        } else {
            return <Redirect to="/homeglobe" />
        }
    }} onProfileClick={() => {
        if (active) {
            return <Redirect to="/profile" />
        } else {
            authenticationError()
            return <Redirect to="/homeglobe" />
        }
    }} />
}

const mapStateToProps = state => {
    return {
        active: state.toggles.navbar
    }
}


const mapDispatchToProps = dispatch => {
    return {
        authenticationError: () => dispatch(authenticationError()),
    }
}


export default connect(mapStateToProps, mapDispatchToProps)(NavbarOther)
